import React from "react";

const Home = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col text-center">
          <h1>AI Real Estate Assistant</h1>
          <p>Your Personal Real Estate Expert</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
